Dies erhielten die Söhne Josephs, Manasses und Ephraim als Besitz.
Als Grenze der Söhne Ephraims nach ihren verschiedenen Geschlechtern und als ihr Besitztum wurde bestimmt gegen Osten Ataroth-Addar bis Ober-Bethhoron;
alsdann läuft die Grenze weiter bis zum Meere. Machmethath aber liegt gegen Norden, dort wendet sich die Grenze ostwärts nach Thanathselo, und geht östlich nach Janoe hinüber;
von Janoe geht sie hinab nach Ataroth und Naaratha, kommt nach Jericho und läuft am Jordan aus.
